import '../../styles/Premise.css';
import user from '../../img/user.svg';


function RentInfo(premise) {
	return (
			<div className="rentInfo">
				<p className="priceRental">Стоимость аренды:</p>
				<p className="moneyRental">{premise.Price}</p>
				<button className="sentRequestToRental">Отправить заявку на аренду</button>
				<p className="priceRental">Владаелец:</p>
				<div className="userInfo">
					<div className="userController">
						<a href='/'>
							<img className="userPhoto" src={user}></img>
						</a>
						<button className="sentMessage">Написать</button>
					</div>
					<p className="userName">Пидор</p>
				</div>

			</div>
  	);
}

export default RentInfo;
